import './App.css';
import React, { useState, useEffect } from 'react';

function App() {
  return (
    <div className="App">
      <head>
        <meta charset="utf-8" />
        <link rel="stylesheet" href="style.css" />
        <title>הבהדון - סגל בה"ד 20</title>
        <meta name="description" content="'הייתי חייל בעייתי, דעתן עם פה גדול' | עיתון משא''ן נובמבר-דצמבר | קרא עוד..." />
        <meta property="og:title" content="הבהדון - עיתון בה''ד 20" />
        <meta property="og:url" content="https://newsletterb.tiiny.site/" />
        <meta property="og:description" content="'הייתי חייל בעייתי, דעתן עם פה גדול' עיתון משא''ן נובמבר-דצמבר" />
        <meta property="og:image"
          content="https://firebasestorage.googleapis.com/v0/b/newsletter-23e70.appspot.com/o/Mashan%20Newsletter%200.7%20thumbnail4.png?alt=media&token=08bf376c-9f5e-44cd-bd83-18e67193a14b" />
        <meta name="theme-color" content="#222221" />
        <meta name="apple-mobile-web-app-status-bar-style" content="#222221" />
      </head>

      <body>
        <div class="cover" id="coverlowres"></div>
        <div class="cover" id="coverhighres"></div>
        <div>
          <img class="long" id="longlowres" src="https://firebasestorage.googleapis.com/v0/b/newsletter-23e70.appspot.com/o/Mashan%20Newsletter%200.8%20long%20highres%20(quality75).webp?alt=media&token=53b15604-9564-45c8-8b44-c794203db870" />
          <img class="long" id="longhighres"
            src="https://firebasestorage.googleapis.com/v0/b/newsletter-23e70.appspot.com/o/Mashan%20Newsletter%200.8%20long%20highres%20(quality75).webp?alt=media&token=53b15604-9564-45c8-8b44-c794203db870" />
        </div>

        <script>
        // First we get the viewport height and we multiple it by 1% to get a value for a vh unit
          let vh = window.innerHeight * 0.01;
          // Then we set the value in the --vh custom property to the root of the document
          document.documentElement.style.setProperty('--vh', `${vh}px`);
        </script>
      </body>
    </div>
  );
}

export default App;
